import React, { Component } from 'react';

import './App.css';
import UserPanel from './UserPanel';
import ProfilePage from './ProfilePage';


class App extends Component {
  render() {
    return (<div>
     <ProfilePage/>
     <UserPanel/>
      </div>
    );
  }
}

export default App;
